import React, { useState } from 'react';

export default class Results extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    let bcbp = JSON.parse(JSON.stringify(this.props.values));
    let id = 0
    return (
      <div>

        {Object.keys(bcbp).map(key => 
          <p value={key}>{key}: {bcbp[key]}</p>
        )}


      </div>
    );
  }
}
